import { Component } from 'react';
import './WorkingArea.sass';
import List from '../list/List';
import Statistics from '../statistics/Statistics';

interface WorkingAreaProps {
    historyP: number;
    statisticsP: number;
  }

class WorkingArea extends Component<WorkingAreaProps> {
    // eslint-disable-next-line @typescript-eslint/no-useless-constructor
    constructor(props:WorkingAreaProps) {
        super(props);
    }
    
    CurrentArea = (hist:number, stats:number) => {
        if (hist === 1 && stats === 0) {
            console.log(hist);
            return (
                <List></List>
            )
        } else {
            return (
                <Statistics></Statistics>
            )    
        }
    }
    render() {
        let {history, statistics} = this.props;
        return (
            <div className="working-area">
                {this.CurrentArea(history, statistics)}
            </div>
        )
    }
}

export default WorkingArea;
